import { redirect } from "react-router-dom";
import axios from "./api/axios";

const Logout = async () => {
  const response = await axios.get("/logout", {
    headers: { "Content-Type": "application/json" },
    withCredentials: true,
  });
  redirect("/login");
  return;
};

export default Logout;
